    true,nt"url": null,nt"notes": "<p>Medicaid Fraud Control Units (MFCU or
    Unit) investigate and prosecute Medicaid fraud as well as patient abuse and neglect
    in health care facilities. OIG certifies, and annually recertifies, each MFCU. OIG
    collects information about MFCU operations and assesses whether they comply with
    statutes, regulations, and OIG policy. OIG also analyzes MFCU performance based
    on 12 published performance standards and recommends program improvements where
    appropriate.</p>n",nt"license_title": "Other License Specified",nt"extras":
